import ReactDOM from "react-dom/client";
import Home from "./pages/Home/Home";
import Sign from "./pages/Sign/Sign";

const App = () => {
  return (
    <Router>
      <Route path="/" component={Home} />
      <Route path="/sign" component={Sign} />
    </Router>
  );
};

export default App;
